import React, {Component} from 'react';
import './App.css';

class App extends Component{
    constructor(props){
        super(props)
        this.state ={
            nounOne: "",
            pluralNoun: "",
            nounTwo: "",
            place: "",
            adjective: "",
            nounThree: ""
        }
    }
    updateNounOne = (event) => {
        this.setState({ nounOne: event.target.value})
    }
    render(){
        return(
            <div>
                <input
                    value={this.state.nounOne}
                    onChange={this.updateNounOne}
                    />

            </div>
        )
    }
}
export default App;
